import Header from './Header';
import styled from 'styled-components';

const PageLayout = styled.div`
    margin: 0;
    padding: 0;
    background: black;
`;

const Layout = props => (
    <PageLayout>
        <Header />
        {props.children}
    </PageLayout>
);

export default Layout;
